import React from "react";
import Book from "./book";

const Booklist = () => {
  return (
    <div
      className="main"
      style={{
        display: "flex",
        flexDirection: "column"
      }}
    >
      <div
        className="main-headers"
        style={{
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          marginTop: "50px",
          padding: "1.5% 10% 1.5% 10%",
          backgroundColor: "teal",
          fontSize: "20px"
        }}
      >
        <p>Title</p>
        <p>Author</p>
        <p>ISBN</p>
        <p>READ?</p>
      </div>

      <div
        className="main-books"
        style={{
          display: "flex",
          justifyContent: "space-between",
          padding: "0% 10% 0% 10%"
        }}
      ></div>

      <div
        className="main-inputs"
        style={{
          display: "flex",
          justifyContent: "space-between",
          padding: "0% 10% 0% 10%"
        }}
      >
        <input type="text" placeholder="title"></input>
        <input type="text" placeholder="author"></input>
        <input type="text" placeholder="isbn"></input>
        <input type="checkbox"></input>
        <button id="submit-button">ADD</button>
      </div>
    </div>
  );
};

export default Booklist;
